import React, { useState } from "react";

// Data for College Clubs (Categorized with Instagram Links & Achievements)
const clubCategories = [
  {
    category: "Cultural Clubs",
    image: "/assets/images/csclub.jpg",
    clubs: [
      {
        name: "Chaitanya Vaadya",
        instagram: "https://www.instagram.com/chaitanya_vaadya",
        founded: "2010",
        mission: "To nurture musical talent and promote cultural harmony through music.",
        achievements: [
          "Performed at over 50 events, including national-level competitions.",
          "Collaborated with renowned artists for workshops and concerts.",
          "Released an original album featuring student compositions.",
        ],
        gallery: ["/assets/images/vaadya1.jpg", "/assets/images/vaadya2.jpg"],
      },
      {
        name: "Chaitanya Geethi",
        instagram: "https://www.instagram.com/chaitanya_geethi",
        founded: "2012",
        mission: "Spreading the joy of classical and contemporary music.",
        achievements: [
          "Winner of the South India Music Contest 2023.",
          "Performed live at various inter-college cultural festivals.",
        ],
        gallery: ["/assets/images/geethi1.jpg", "/assets/images/geethi2.jpg"],
      },
    ],
  },
  {
    category: "Technical Clubs",
    image: "/assets/images/tech.jpg",
    clubs: [
      {
        name: "Praheti Racing",
        instagram: "https://www.instagram.com/prahetiracing",
        founded: "2015",
        mission: "Innovating in the field of automotive engineering.",
        achievements: [
          "Ranked in the Top 35 at SUPRA 2024 (Buddh International Circuit).",
          "Built a fully functional electric vehicle prototype.",
        ],
        gallery: ["/assets/images/praheti1.jpg", "/assets/images/praheti2.jpg"],
      },
      {
        name: "CBIT DSC",
        instagram: "https://www.instagram.com/cbitdsc",
        founded: "2018",
        mission: "Empowering students with Google Developer Technologies.",
        achievements: [
          "Recognized as a Tier-1 Institution by Google Developer Community.",
          "Conducted over 50+ coding bootcamps and hackathons.",
        ],
        gallery: ["/assets/images/dsc1.jpg", "/assets/images/dsc2.jpg"],
      },
    ],
  },
];

function About() {
  const [activeClub, setActiveClub] = useState(null);

  const toggleAccordion = (clubName) => {
    setActiveClub(activeClub === clubName ? null : clubName);
  };

  return (
    <section className="py-20 px-10 bg-white text-center">
      <h2 className="text-4xl font-bold text-primary mb-4">About Eventify</h2>
      <p className="text-gray-600 text-lg">
        Eventify is a club management platform designed to streamline event organization, resource booking, and communication.
        It simplifies managing college events by providing an intuitive interface for organizers and attendees alike.
      </p>

      <br />
      <h2 className="text-4xl font-bold text-primary mb-8">Our College Clubs</h2>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
        {clubCategories.map((category, index) => (
          <div
            key={index}
            className="bg-gray-100 shadow-lg rounded-lg p-6 hover:shadow-2xl transition-all duration-300"
          >
            <img
              src={category.image}
              alt={category.category}
              className="w-full h-48 object-cover rounded-lg mb-4"
            />
            <h3 className="text-2xl font-semibold text-primary mb-4">
              {category.category}
            </h3>

            <ul className="text-left">
              {category.clubs.map((club, idx) => (
                <li key={idx} className="mb-2">
                  <button
                    onClick={() => toggleAccordion(club.name)}
                    className="text-lg text-blue-600 font-semibold hover:underline"
                  >
                    {club.name}
                  </button>

                  {activeClub === club.name && (
                    <div className="mt-2 bg-gray-200 p-4 rounded-lg shadow-md">
                      <p>
                        <strong>Founded:</strong> {club.founded}
                      </p>
                      <p>
                        <strong>Mission:</strong> {club.mission}
                      </p>
                      <p>
                        <strong>Achievements:</strong>
                      </p>
                      <ul className="list-disc list-inside text-left ml-4">
                        {club.achievements.map((achievement, i) => (
                          <li key={i} className="text-gray-700">
                            {achievement}
                          </li>
                        ))}
                      </ul>
                      <div className="grid grid-cols-2 gap-4 mt-3">
                        {club.gallery.map((img, i) => (
                          <img
                            key={i}
                            src={img}
                            alt={`Gallery ${i + 1}`}
                            className="rounded-lg shadow-md"
                          />
                        ))}
                      </div>
                      <a
                        href={club.instagram}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="block text-blue-500 mt-2 hover:underline"
                      >
                        Visit Instagram â†’
                      </a>
                    </div>
                  )}
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </section>
  );
}

export default About;
